import React from 'react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from 'recharts';

const Chart = ({ chart, onClick }) => {
  // Assuming 'chart.data' is an array of objects suitable for Recharts
  // You might need to adjust this depending on the actual data structure
  return (
    <div className="chart-item" onClick={onClick}>
      <h3>{chart.title}</h3>
      <BarChart width={600} height={300} data={chart.data}>
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Bar dataKey="value" fill="#8884d8" />
      </BarChart>
    </div>
  );
};

export default Chart;
